import styled from 'styled-components';

export const Container = styled.header``;

export const Nav = styled.nav`
  justify-content: space-around;
  background: blue;
  width: 100%auto;
`;

export const Link = styled.a``;

export const Logo = styled.img`
  object-fit: contain;
  width: 15%;
`;
